package cn.xgame.config.o;import java.util.Map;import x.javaplus.string.StringUtil;public class Equip_auxiliaryPo {	public final int id;	public final int hp;	public final int needen;	public final int mess;	public final int push;	public final int precision;	public final int complexity;	public final int addsurplus;	public final int dur;	public final String gird;	public final String answers;	public final String asking;

	public Equip_auxiliaryPo( Equip_auxiliaryPo clone ){		this.id = clone.id;		this.hp = clone.hp;		this.needen = clone.needen;		this.mess = clone.mess;		this.push = clone.push;		this.precision = clone.precision;		this.complexity = clone.complexity;		this.addsurplus = clone.addsurplus;		this.dur = clone.dur;		this.gird = clone.gird;		this.answers = clone.answers;		this.asking = clone.asking;

	}	public Equip_auxiliaryPo( Map<String, String> data ){		id = Integer.parseInt( StringUtil.convertNumberString( data.get("id") ) );		hp = Integer.parseInt( StringUtil.convertNumberString( data.get("hp") ) );		needen = Integer.parseInt( StringUtil.convertNumberString( data.get("needen") ) );		mess = Integer.parseInt( StringUtil.convertNumberString( data.get("mess") ) );		push = Integer.parseInt( StringUtil.convertNumberString( data.get("push") ) );		precision = Integer.parseInt( StringUtil.convertNumberString( data.get("precision") ) );		complexity = Integer.parseInt( StringUtil.convertNumberString( data.get("complexity") ) );		addsurplus = Integer.parseInt( StringUtil.convertNumberString( data.get("addsurplus") ) );		dur = Integer.parseInt( StringUtil.convertNumberString( data.get("dur") ) );		gird = data.get("gird");		answers = data.get("answers");		asking = data.get("asking");

	}}